function printObjectInTable(e,t){var n=getTHeadIDs(t),r=n.length,i=document.createElement("tr");for(var s in n){var o=document.createElement("td");if(e.hasOwnProperty(s)){o.appendChild(document.createTextNode(e[s]))}i.appendChild(o)}document.getElementById(t).getElementsByTagName("tbody")[0].appendChild(i)}function getTHeadIDs(e){var t=document.getElementById(e).getElementsByTagName("th"),n=t.length,r=[];for(var i=0;i<n;i++){r[i]=t[i].id}return r}